// 기본 api url 주소
const URL_API = "http://localhost:8080/api/v1";

// hello api url 주소
const URL_HELLO = 'http://localhost:8080/api/v1/hello';

// surveyDTO api url 주소
const URL_SURVEYDTO = 'http://localhost:8080/api/v1/surveyDTO';

function hello(){
    return fetch(URL_HELLO)
        .then(response => {
            return response.text();
        })
        .then(hello => {
            return hello;
        })
        .catch(error => console.log(error));
}

function getSurveyDTO(){
    return fetch(URL_SURVEYDTO)
        .then(response => {
            return response.json();
        })
        .then(surveyDTO => {
            return surveyDTO;
        })
        .catch(error => console.log(error));
}

export {
    hello,
    getSurveyDTO
}
